    private string IsPreview()
    {
        var isPreview = Context.Request.Cookies["isPreview"] ?? "false";
        
        Context.Response.Headers.TryGetValue("Set-Cookie", out var cookie);
        if (!cookie.ToString().Contains("isPreview=true;")) return isPreview;

        isPreview = "true";
        Context.Response.Redirect(Context.Request.Path);
        return isPreview;
    }

